import axios from "axios";
import {appConstants} from "../constants/constant";

const API = 'http://localhost:8089';

export const getPendingPayments = (uid) => {
    const getPendingPaymentsPromise = axios.get(`${API}/paymentHistories/pending/${uid}`);

    return {
        type: appConstants.GET_PENDING_PAYMENT,
        payload: getPendingPaymentsPromise
    };
};
